/* Aligner les photos à gauche et le texte à droite */
.wrapper .container .row {
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: center;
}

/* Ajouter une image de fond */
.wrapper {
    background-image: url('./assets/img/photos/bg4.jpg');
    background-size: cover;
    background-position: center;
}

/* Styling du texte */
.wrapper .content {
    width: 45%; /* Ajuster la largeur du texte à droite */
}

/* Styling des boutons */
.wrapper .content .btn {
    margin-right: 10px; /* Espacement entre les boutons */
}
